def init(timeUnits = 1):
    for x in stations.keys(): 
        for y in ['weekend','weekday']:
	        stations[x][y]={}
	        stations[x][y]['inCount']=[0.0]*timeUnits
	        stations[x][y]['outCount']=[0.0]*timeUnits
	        if stations[x]['TRANSFER_TAG'] == '普通站':
	        	stations[x][y]['transferCount']=[0.0]*timeUnits
	        else:
	        	stations[x][y]['transferCount']=[0.0]*timeUnits
    return stations

def saveSatationsData(stations, filePath = 'stationsDataCalculated.txt'):
    # stations={'a':'你好'}
    savePropertyList = ['X','Y','LINE_NO']
    text = '{\n'
    for stationName in stations.keys():
        text += '"%s":{' %(stationName)
        for propertyName in savePropertyList:
            text += '"%s":"%s",' % (propertyName,stations[stationName][propertyName])
        for day in ['weekday','weekend']:
            text += '"%s":{' %(day)
            for count in ['inCount','outCount','transferCount']:
                text += '"%s":[' %(count)
                temp = stations[stationName][day][count]
                for x in temp:
                    text += '%d,'%(x)
                text = text[:-1] + '],'
            text = text[:-1] + '},'
        text = text[:-1] + '},\n'
    text = text[:-2]+'\n}'

    file_object = open(filePath, 'w')
    file_object.write(text)
    file_object.close()

